import React, { useState } from 'react';
import { Link } from 'react-router-dom';

const DaftarAkun1 = () => {
  const [password, setPassword] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");
  const [passwordVisible, setPasswordVisible] = useState(false);

  const handleTogglePassword = () => {
    setPasswordVisible(!passwordVisible);
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    if (password === "" || confirmPassword === "") {
      alert("Please fill in all fields.");
      return;
    }

    if (password !== confirmPassword) {
      alert("Passwords do not match.");
      return;
    }

    console.log("New Password: " + password);
    // Handle password reset logic here
  };

  return (
    <>
    {/* Import Google Font Poppins */}
    <link
      href="https://fonts.googleapis.com/css2?family=Poppins:wght@400;500;600;700&display=swap"
      rel="stylesheet"
    />

    {/* Import Font Awesome (v6) */}
    <link
      rel="stylesheet"
      href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.0.0-beta3/css/all.min.css"
      integrity="sha384-k6RqeWeci5ZR/Lv4MR0sA0FfDOM/8zrtkTzMEx0bztElX26pESiUz9Aupq6An3c"
      crossOrigin="anonymous"
    />
    
    <div className="min-h-screen flex" style={{ fontFamily: "'Poppins', sans-serif" }}>
        <div className="relative w-1/2">
          <img src="background.jpg" alt="Background Image" className="w-full h-full object-cover"/>
          <div className="absolute top-0 left-0 w-full h-full bg-black bg-opacity-50 flex flex-col justify-center items-center">
            <h1 className="text-6xl text-teal-300">Logo</h1>
            <h2 className="text-2xl text-white mt-4 mb-4">Nama Website</h2>
            <p className="text-lg text-white text-center w-3/4">
              Jelajahi ribuan footage menarik di website kami!
            </p>
          </div>
        </div>
      <div className="w-1/2 bg-gray-800 flex flex-col justify-center items-center p-10">
        <h1 className="text-4xl mb-6 text-white font-bold">Daftar Akun</h1>
        <p className="text-lg mb-8 text-white">Ayo Selesaikan Pendaftaran dan Segera bergabung ke Tomb Oati Market</p>
        <form onSubmit={handleSubmit} className="w-full">
          <label htmlFor="password" className="block text-lg mb-2 text-white">
            Nama Depan
          </label>
          <div className="relative mb-6">
            <input
              type={passwordVisible ? "text" : "password"}
              id="password"
              name="password"
              placeholder="Masukkan password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              className="w-full p-3 rounded bg-white text-black pr-12"
            />
            <i
              className={`fas ${
                passwordVisible ? "fa-eye-slash" : "fa-eye"
              } absolute right-3 top-3 cursor-pointer`}
              onClick={handleTogglePassword}
            ></i>
          </div>

          <label htmlFor="confirmPassword" className="block text-lg mb-2 text-white">
            Nama Belakang
          </label>
          <div className="relative mb-6">
            <input
              type={passwordVisible ? "text" : "password"}
              id="confirmPassword"
              name="confirmPassword"
              placeholder="Masukkan password"
              value={confirmPassword}
              onChange={(e) => setConfirmPassword(e.target.value)}
              className="w-full p-3 rounded bg-white text-black pr-12"
            />
            <i
              className={`fas ${
                passwordVisible ? "fa-eye-slash" : "fa-eye"
              } absolute right-3 top-3 cursor-pointer`}
              onClick={handleTogglePassword}
            ></i>
          </div>

          <button
            type="submit"
            className="w-full bg-blue-500 text-white font-bold py-3 rounded-lg mt-4"
          ><Link to="/daftar-akun2">Berikutnya</Link>
          </button>
        </form>
      </div>
    </div>
    </>
  );
};


export default AkunBerhasilDipulihkan;
